import { MenuProps, SECTION } from "../App";
import { HomeIcon } from "../icons/HomeIcon";
import "../styles/strands.css";

export default function Strands({ section, setSection }: MenuProps) {
  const initial = [
    ["D", "I", "P", "L", "O", "M", "A", "T"],
    ["S", "U", "I", "T", "S", "K", "I", "M"],
    ["S", "C", "O", "N", "V", "E", "N", "I"],
    ["E", "N", "C", "E", "G", "O", "O", "O"],
    ["D", "P", "L", "A", "C", "E", "P", "A"],
    ["S", "T", "L", "I", "V", "E", "S", "C"],
    ["H", "A", "L", "L", "E", "N", "G", "E"],
    ["R", "S", "A", "N", "A", "T", "O", "M"],
    ["Y", "O", "F", "A", "F", "A", "L", "L"],
  ];

  const correct = [
    "DIPLOMAT",
    "SUITS",
    "KIMSCONVENIENCE",
    "GOODPLACE",
    "PASTLIVES",
    "CHALLENGERS",
    "ANATOMYOFAFALL",
  ];

  const pangram = "WATCHLIST";

  return (
    <>
      <div className="home" onClick={() => setSection(SECTION.NONE)}>
        {HomeIcon}
      </div>
      <div className="body" style={{ height: window.innerHeight }}>
        <div className="board">
          {initial.map((row) => (
            <div className="strands-row">
              {row.map((letter) => (
                <p className="letter">{letter}</p>
              ))}
            </div>
          ))}
        </div>
        <div className="footer"></div>
      </div>
    </>
  );
}
